            <div class="home__faq">

                <h2 class="home__title  home__title--spaced">Frequently Asked Questions</h2>

                <div class="home__faq-container">

                    <input type="checkbox" id="homefaq01" class="home__faq-chk">
                    <div class="home__faq-item">
                        <label for="homefaq01" class="home__faq-toggle">How Long Does It Take?</label>
                        <div class="home__faq-text">
                            <p>Each time the credit bureaus receive your dispute letters they have 30 days to conduct
                                their review. That is why we allow you to update your credit report and create new
                                dispute letters every 30 days. </p>
                        </div>
                    </div>

                    <input type="checkbox" id="homefaq02" class="home__faq-chk">
                    <div class="home__faq-item">
                        <label for="homefaq02" class="home__faq-toggle">Do I Have to Print and Mail the
                            Letters?</label>
                        <div class="home__faq-text">
                            <p>You will have the option to pay a small fee to have your letters printed and mailed by a
                                third party company. You will also have the option to print and mail the letters
                                yourself. You will have the ability to email your letters to yourself or download them
                                at any time from the client portal.</p>
                        </div>
                    </div>

                    <input type="checkbox" id="homefaq03" class="home__faq-chk">
                    <div class="home__faq-item">
                        <label for="homefaq03" class="home__faq-toggle">How Do I Know Which Accounts to
                            Dispute?</label>
                        <div class="home__faq-text">
                            <p>Our software will automatically identify the negative accounts on your credit report and
                                provide you with recommended dispute options based on the account type and other account
                                details. We make it easy for you to repair your credit yourself. </p>
                        </div>
                    </div>

                    <input type="checkbox" id="homefaq04" class="home__faq-chk">
                    <div class="home__faq-item">
                        <label for="homefaq04" class="home__faq-toggle">Can I Use This In Any State?</label>
                        <div class="home__faq-text">
                            <p>Yes! We offer this service in all 50 states. </p>
                        </div>
                    </div>

                    <input type="checkbox" id="homefaq05" class="home__faq-chk">
                    <div class="home__faq-item">
                        <label for="homefaq05" class="home__faq-toggle">Which Bureaus Are Disputed?</label>
                        <div class="home__faq-text">
                            <p>The Disputes are designed for the three major bureaus: Equifax, Experian, and Transunion
                            </p>
                        </div>
                    </div>

                </div>

